#Programa - Calcula as anomalias de SST - entre 1870 a 2020
import netCDF4
import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
from pandas.tseries.offsets import DateOffset

def parse_data_sst(sst_file, new_sst_moth):
    sst = sst_file.variables['sst'][:]

    lons = sst_file.variables['lon'][:]-180
    lats = sst_file.variables['lat'][:]
    dd=pd.date_range('1854-01','2021-' + new_sst_moth,freq='M')

    #%%

    z=np.concatenate([sst[:,:,90:],sst[:,:,:90]],axis=2); z[z==-9.9692100e+36]=np.nan #-9.9692100e+36
    df = pd.DataFrame(z.reshape((len(dd),-1)),index=dd); 
    df.index=dd
    #df.to_csv('SSTConsolidado.csv');

    #%%
    xx,yy = np.meshgrid(lons, lats)

    longitude=xx.reshape( -1)
    latitude=yy.reshape( -1)
    #dfi=pd.DataFrame([xx.reshape( -1),yy.reshape( -1)]).T
    #dfi.columns=['longitude','latitude']
    #dfi.to_csv('SSTLatLon.csv');

    #%% Regioes de Estudo
    # R0 - ONI - El NINO 3.4,   lat -5 a 5,          lon -170 a -120  (-10 a -60) 
    # R1 - Pacifico Sul,        lat  = - 45  a -20,  lon -90 a -70  
    # R2 - Atlântic Sul,        lat  = - 50  a -30,  lon -70 a -50  
    # R3 - Atlântico Sudeste,   lat  = - 45  a -15,  lon -50 a 0  
    # R4 - Atlântico Equatorial,lat  = - 5  a 20,  lon -50 a 0 

    #%%

    # df1 = (df.loc[(df.index < "1854-01-01") | (df.index > "1869-12-31")])

    r0=np.nanmean(df.iloc[:,((latitude>-5) & (latitude<=5) &(longitude>-170) & (longitude<=-120))],axis=1)
    r1=np.nanmean(df.iloc[:,((latitude>-45) & (latitude<=-20) &(longitude>-90) & (longitude<=-70))],axis=1)
    r2=np.nanmean(df.iloc[:,((latitude>-50) & (latitude<=-30) &(longitude>-70) & (longitude<=-50))],axis=1)
    r3=np.nanmean(df.iloc[:,((latitude>-45) & (latitude<=-15) &(longitude>-50) & (longitude<=0))],axis=1)
    r4=np.nanmean(df.iloc[:,((latitude>-5) & (latitude<=20) &(longitude>-50) & (longitude<=0))],axis=1)
    
    rs =[r0, r1, r2, r3, r4]

    anomalia = {}
    # dd2=pd.date_range('1870-01','2021-' + new_sst_moth,freq='M')#.shift(-16, freq='D')
    
    # df_anom = pd.DataFrame()#, name="anomalias_SST")
    
    dd2=pd.date_range('1870-01','2020-01',freq='M')#.shift(-16, freq='D')

    df_anom = pd.DataFrame(index=dd2)#, name="anomalias_SST")

    for n in range(5):
        rr = rs[n]
        dfx = pd.DataFrame(rr,columns=['regiao'],index=dd);
        anomalia[n] = []
        dfm=pd.DataFrame(dfx.groupby(by=[dfx.index.month]).mean(),columns=['regiao']);
        for i in range(0,30):
            dfm['r'+str(i)]=dfx.iloc[0+i*60:390+i*60].groupby(by=[dfx.iloc[0+i*60:390+i*60].index.month]).mean()
            med=pd.concat([dfm['r'+str(i)]]*5,ignore_index=True)    
            anomalia[n].append((np.array(dfx.iloc[14*12+i*60:19*12+i*60,0])-np.array(med)))

            #med2=pd.concat([dfm['r'+str(26)]]*5,ignore_index=True)
            #anomalia.append((np.array(dfx.iloc[14*12+27*60:19*12+27*60,0])-np.array(med2)))

        anom=np.concatenate(anomalia[n])

        #anom=pd.DataFrame(anom,columns=['anomalia_R'+str(n)])
        #anom.index = dd2

        df_anom['anomalia_R'+str(n)] = anom
    print(df_anom)


    #%% Salva os dados de SSt de cada regiao
    dfz = pd.DataFrame(r0,columns=['r0'],index=dd);
    dfz['r1'] = pd.DataFrame(r1,index=dd);
    dfz['r2'] = pd.DataFrame(r2,index=dd);
    dfz['r3'] = pd.DataFrame(r3,index=dd);
    dfz['r4'] = pd.DataFrame(r4,index=dd);

    return 